import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
//import App from './App';
import Card from "./Cards";
import Sdata from "./Sdata";



ReactDOM.render(
<>
<h1 id="hedding">list of top 3 NETFLIX serise in 2020</h1>

<Card  imgsrc={Sdata[0].imgsrc}
        sname={Sdata[0].sname}
       title={Sdata[0].title}

       link={Sdata[0].link}
/>
<Card  imgsrc={Sdata[1].imgsrc}
        sname={Sdata[1].sname}
       title={Sdata[1].title}

       link={Sdata[1].link}
/>
<Card  imgsrc={Sdata[2].imgsrc}
       sname={Sdata[2].sname}
       title={Sdata[2].title}

       link={Sdata[2].link}
/>
</>
,
document.getElementById("root")
);
